import React from "react";
import { connect } from "react-redux";
import { logout } from "../../../actions/auth";

const Dropdown = ({ logout }) => {
  return (
    <div id='nav-dropdown'>
      <div className='dropdown-item'>
        <span onClick={logout}>Logout</span>
      </div>
      <div className='dropdown-item'>
        <span>Profile</span>
      </div>
    </div>
  );
};

export default connect(
  null,
  { logout }
)(Dropdown);
